INSERT INTO `scartas` VALUES (1,'Carta para Ofertas','Muy Sres. nuestros:','Por la presente, y atendiendo a sus gratos deseos, nos complace remitirles nuestro estudio econmico, destinado al suministro del asunto que nos ocupa.','No obstante, si al examinarlo precisaran de alguna aclaracin o variante sobre el particular, no duden ponerse en contacto con nosotros.',NULL,'A la espera de sus gratas noticias, aprovechamos la ocasin para saludarles'),(2,'Recordatorio de Oferta Recordatorio de OfertaRecor','Muy Sres. nuestros:','Aprovechamos la presente para recordarles que fechas atras contacto con nosotros con el fin de solicitarnos presupuesto economico.','Por nuestra parte les remitimos nuestras mejores ofertas atendiendo a su peticin con los siguientes nmeros:','No habiendo recibido a fecha de hoy respuesta por su parte, le recordamos que estamos a su entera disposicin para cualquier aclaracin o presupuesto que sea de su inters.','Sin otro particular, y a la espera de sus gratas noticias, reciban un cordial saludo.'),(3,'Confirmacion de Pedidos','Muy Sres. nuestros:','Agradecemos su atencin al contactar con nuestros servicios, y acusamos recibo de su/s atento/s pedido/s de acuerdo con las condiciones acordadas.',NULL,NULL,'Le rogaria nos encien una copia del R.C. para la compra del material que se detalla en el pedido adjunto. ARIG'),(5,NULL,NULL,NULL,NULL,NULL,NULL);
/*!40000 ALTER TABLE `scartas` ENABLE KEYS */;
