INSERT INTO `sfichtecnicamp` VALUES (0,1,1,'INGREDIENTES  ','100% aceite de oliva virgen extra, obtenido nicamente a partir de la primera extraccin en fro de las aceitunas. Aceite obtenido del fruto del olivo por procedimientos mecnicos, sin tratamiento posterior diferente al lavado, decantacin, centrifugacin, filtrado y envasado.'),(0,1,2,'DESCRIPCIN','Aceite de oliva de categora superior obtenido directamente de aceitunas y slo mediante procedimientos mecnicos.'),(0,1,3,'CONDICIONES DE ALMACENAMIENTO Y DISTRIBUCIN','Almacenar en ambiente seco, fresco y al abrigo de la luz.'),(0,1,4,'CONDICIONES DE USO','Almacenamiento domstico en ambiente fresco y seco, protegido de la luz solar. Hacer uso del tapn.\r\nEste producto va destinado a toda la poblacin en general, sin excluir a ningn grupo (incluidos nios y ancianos).El aceite a bajas temperaturas puede presentar enturbiamiento e incluso pricipitacion, que en nada afecta a sus caracteristicas. '),(0,1,5,'VIDA UTIL','Consumo preferente maximo 18  meses tras la fecha de envasado.'),(0,1,6,'CRITERIOS MICROBIOLGIGOS Y FISICOQUMICOS DE APLICACIN','Libres de microorganismos patgenos  de sus toxinas, metales pesados y otras sustancias peligrosas segn las normas y cantidades establecidas por la reglamentacin sanitaria. Libres de parsitos en cualquiera de sus formas. Conforme a la reglamentacin tcnico-sanitaria de aplicacin. R (CEE) 2568/91 y sus modificaciones. \r\nNo contiene alrgenos y est libre de OGM\'s'),(0,1,7,'CARACTERSTICAS ORGANOLPTICAS','Aspecto lmpido mantenido a 20 (+/-  2C) durante 24 horas, con la excepcin de los aceites sin filtrar. Olor y sabor propios del producto, segn se regulan en la reglamentacin de la Unin Europea R (CEE) 2568/91 y posteriores modificaciones.\r\nColor variable, en tonalidades del verde al amarillo.                                                                                          VALORACION ORGANOLEPTICA:\r\nMediana del Defecto : Md=0  ..............................................Mediana del Frutado :  Mf>0\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n    \r\n\r\n\r\n\r\n\r\n\r\n                                                                                                                                                                    \r\n'),(0,6,1,'INGREDIENTES','El aceite de orujo de oliva contiene exclusivamente aceites de orujo de oliva refinados y aceites de oliva vrgenes.'),(0,6,2,'DESCRIPCION ','Aceite que contiene exclusivamente aceites procedentes del tratamiento del orujo de oliva y de aceites obtenidos directamente de aceitunas.'),(0,6,3,'CONDICIONES DE ALMACENAMIENTO Y DISTRIBUCIN','Almacenamiento en condiciones tcnicas apropiadas, en depsitos de materiales que no produzcan migraciones indeseables a los aceites y mantenindose debidamente protegido de las condiciones ambientales adversas, especialmente de luz y temperatura, que puedan alterar sus caractersticas fsico-qumicas y organolpticas. Depsitos con cierre  tapados.'),(0,6,4,'CONDICIONES DE USO','Almacenamiento domstico en ambiente fresco y seco, protegido de la luz solar. Hacer uso del tapn.\r\nEste producto va destinado a toda la poblacin en general, sin excluir a ningn grupo.'),(0,6,5,'VIDA UTIL ','Consumo preferente. Maximo 24 meses tras fecha de envasado. '),(0,6,6,'CRITERIOS MICROBIOLGIGOS Y FISICOQUMICOS DE APLICACIN','Libres de microorganismos patgenos  de sus toxinas, metales pesados y otras sustancias peligrosas segn las normas y cantidades establecidas por la reglamentacin sanitaria. Libres de parsitos en cualquiera de sus formas. Conforme a la reglamentacin tcnico-sanitaria de aplicacin. R (CEE) 2568/91. '),(0,6,7,'CARACTERSTICAS ORGANOLPTICAS','Aspecto lmpido mantenido a 20  +   2C durante 24 horas. Con aromas pro